#pragma mark - Table view data source

- (NSInteger)numberOfSectionsInTableView:(UITableView *)tableView
{
    return 1;
}


- (NSInteger)tableView:(UITableView *)tableView numberOfRowsInSection:(NSInteger)section 
{

    NSUInteger count;

    if(self.isFiltered)
        count   = filteredTableData.count;
    else
        count = allTableData.count;
    
    return count;
    
}


- (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath
{
    
    static NSString *CellIdentifier = @"Cell";
    
    UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:CellIdentifier];
    if (cell == nil)
        cell = [[UITableViewCell alloc] initWithStyle:UITableViewCellStyleSubtitle reuseIdentifier:CellIdentifier];
    
    Karen* word;
    if(isFiltered)
        
    word = [filteredTableData objectAtIndex:indexPath.row];
    else
        word = [allTableData objectAtIndex:indexPath.row];
    
    cell.detailTextLabel.text = word.detail;
    cell.textLabel.text = word.name;
    cell.textLabel.textColor = [UIColor whiteColor];
    cell.backgroundColor = [UIColor colorWithRed:0.29 green:0.29 blue:0.29 alpha:1.0];
    cell.detailTextLabel.textColor = [UIColor colorWithRed:0.90 green:0.31 blue:0.31 alpha:1.0];

    
    //cell.detailTextLabel.text = word.description;
    //cell.detailTextLabel.text =word.detail;
    //cell.detailTextLabel.text = word.synonyms;
    
    return cell;
    }

#pragma mark - Table view delegate

-(void)searchBar:(UISearchBar*)searchBar textDidChange:(NSString*)text {
    if(text.length == 0)
        
    {
        isFiltered = FALSE;
    }
    else
    {
        isFiltered = true;
        filteredTableData = [[NSMutableArray alloc] init];
        
        for (Karen* word in allTableData)
        {
            NSRange nameRange = [word.name rangeOfString:text options:NSCaseInsensitiveSearch];
            NSRange descriptionRange = [word.description rangeOfString:text options:NSCaseInsensitiveSearch];
            NSRange detailRange = [word.detail rangeOfString:text options:NSCaseInsensitiveSearch];
           
           

            
            
            if(nameRange.location != NSNotFound || descriptionRange.location != NSNotFound || detailRange.location != NSNotFound )
            {
                [filteredTableData addObject:word];
            }
        }
    }
    
    [self.tableView reloadData];
}

- (void)tableView:(UITableView *)tableView accessoryButtonTappedForRowWithIndexPath:(NSIndexPath *)indexPath
{
    [self showDetailsForIndexPath:indexPath];
}


-(void)tableView:(UITableView *)tableView didSelectRowAtIndexPath:(NSIndexPath *)indexPath
{
    [self showDetailsForIndexPath:indexPath];
}

-(void) showDetailsForIndexPath:(NSIndexPath*)indexPath
{
    [self.searchBar resignFirstResponder];
    DetailViewController* EM = [self.storyboard instantiateViewControllerWithIdentifier:@"DetailViewController"];
    Karen* karen;
    
    
    if(isFiltered)
    {
        karen = [filteredTableData objectAtIndex:indexPath.row];
        

    }
    else
    {
        karen = [allTableData objectAtIndex:indexPath.row];
       


    }
    
    EM.karen = karen;
    [self.navigationController pushViewController:EM animated:true];
}

-(UIStatusBarStyle)preferredStatusBarStyle
{
    return UIStatusBarStyleDefault;
}


- (IBAction)goToSearch:(id)sender
{
    // If you're worried that your users might not catch on to the fact that a search bar is available if they scroll to reveal it, a search icon will help them
    // Note that if you didn't hide your search bar, you should probably not include this, as it would be redundant
    [searchBar becomeFirstResponder];
}



